export const arrayUtils = {
  unique: (arr) => [...new Set(arr)],
  shuffle: (arr) => arr.sort(() => Math.random() - 0.5),
  chunk: (arr, size) => {
    const chunks = []
    for (let i = 0; i < arr.length; i += size) {
      chunks.push(arr.slice(i, i + size))
    }
    return chunks
  }
}

